import React from 'react'
import './Weather.css'
import WeatherNow from './WeatherNow/WeatherNow'
import WeatherForecast from './WeatherForecast/WeatherForecast'

export default function Weather() {

  return (
  <div className='weather-wrapper'>
    <WeatherNow />
    <WeatherForecast />
  </div>
  )
}
